import React from 'react';
import Gif from './Gif';

const GifList = props => {
  const results = props.data;
  let gifs = results.map(gif => <Gif
    url={gif.images.fixed_height.url}

  />);

  return(
    <ul className="gif-list">
      <Gif />
    </ul>
  );
}

export default GifList;
